records.addlTxt:
Defendant in custody.
The State moves to dismiss the 2nd and subsequent enhancers in counts 3 and 5.  Motion granted.
NO CONTEST plea entered to the amended charge of deliver cocaine within 1000 feet of park in count 3.  Convicted.
NO CONTEST plea entered to the amended charge of deliver morphine within 1000 feet of park in count 5.  Convicted.
The State moves to dismiss and read in counts 1,2,4,6 and 7.  Motion granted.
The defendant is sentenced to the Wisconsin State Prison System for a total of three (3) years. That is eighteen (18) months initial confinement followed by eighteen (18) months extended supervision, on each count, consecutive.
The Court finds the defendant not eligible for the Challenge Incarceration Program.  The defendant is found eligible for the Substance Abuse Program.
Defendant has credit for 207 days.
Conditions of extended supervision:
1) AODA assessment and follow through;
2) assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
3) submit to random urine screens and pay for same;
4) maintain fulltime employment if defendant is physically able to work;
5) pay court costs including $260.00 buy money;
6) provide DNA sample;
7) pay supervision fees in an amount to be determined by DOC.
Minutes.
